import Logo from './Logo';
import { fonts } from '../shared/styles';

export default function PageTitle() {
  return (
    <header>
      <Logo color="amber" />
      <h1>
        <span>Christ the King</span>
        <span>Anglican Church</span>
      </h1>
      <style jsx>{`
        header {
          color: white;
          height: 100vh;
          padding: 20px;
          position: relative;
          text-align: center;
          z-index: 3;
        }

        h1 {
          font-family: ${fonts.serif};
          line-height: 1.1;
          padding-top: 40%;
        }

        span {
          display: block;
        }
      `}</style>
    </header>
  )
}
